import { useState } from "react";
import useLoaded from "../utils/Loaded";

function Other() {

    const [ text, setText ] = useState("LOL")

    let loadedRender = () => { return <p>{text}</p> }

    const [ isLoading, setIsLoading, render ] = useLoading(loadedRender)

    setTimeout( () => { setText("LOOOOOOL"); setIsLoaded() }, 3000)


}

export default Other;
